const LikeButton = ({ addLike }) => {
    return (
        <div>
          <button
            className="button"
            onClick={this.addLike}
          >
            <i className="far fa-heart fa-lg" style={{ color: "#33c3f0" }}></i>
          </button>
        </div>
    )
}

export default LikeButton
